                <div style={{}}>
                    <h1>Home Page</h1>
                    <div className="ui conteiner">
                        <h2>Start with:</h2>
                        <button class="ui facebook button">
                            <i class="facebook icon"></i>
                            Facebook
</button>
                        <button class="ui google plus button">
                            <i class="google plus icon"></i>
                            Google Plus
</button>
                    </div>
                </div>
            </Layout>
        )
    }
}

export default Home;
